import React from "react";

function Test(){
    return (
        <div>
            <p>{this.movie.title}</p>
            <p>{this.movie.director}</p>
            <p>{this.movie.country}</p>
            <img src={this.movie.posterUrl} alt={this.movie.title}/>
        </div>
    )
}

export default Test;
